conf_to_build: n750
target: "ath79"
device: "mynet-n750"
package_id: mips_24kc
image_name: generic
extension: bin
image_path: "ath79/generic/openwrt-ath79-generic-mynet-n750-squashfs-sysupgrade.bin"
image_paths:
  - "ath79/generic/openwrt-ath79-generic-mynet-n750-squashfs-sysupgrade.bin"
  - "ath79/generic/openwrt-ath79-generic-mynet-n750-squashfs-factory.bin"
supported: true

channel: 1
# 5ghz note only 20mhz channel widths
five_ghz_channel: 165

# babel interfaces for gateway operation
listen_interfaces:
  - eth0.2
  - eth0.3
  - eth0.4
  - eth0.5

lan_interfaces: "eth0.1"

# Reference value, see network.j2 to modify
#wan_interface: "eth0.2"

# For sqm tuning
real_interfaces:
  - eth0
# Estimated max wireguard throughput in kbits/s
est_max_throughput: 40000

rust_target: mips-unknown-linux-musl
